Polar Storm (2009)  

Verenigde Staten
Actie / Science-Fiction

geregisseerd door Paul Ziller
met Jack Coleman, Holly Dignard en Tyler Johnston

Een deel van de planeet Kopernikus breekt af en stort neer op aarde. Daardoor raakt het magnetische veld op aarde van slag. Hevige stormen bedreigen grote delen van de Verenigde Staten. De onderzoeker James Mayfield had de regering voorheen al voor deze stormen gewaarschuwd. Hij moet nu alles op alles zetten om zijn familie te redden, die direct door de stormen bedreigd worden.


